  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pea Island NWR
  outlines Refuge accomplishments from September through December of 1947. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, and furbearers- is also
  covered. The Refuge development and maintenance section discusses physical developments.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and violations. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
